script: |
  super -f text -I q13403.spq | sort > q13403.out

inputs:
  - name: q13403.spq
    data: |
      SELECT DISTINCT + - COUNT ( * ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col0 IN ( + col0 + + 45 - + col2, ( - - col0 ) * + - 22, + - col0 + + - 75 ) );
  - name: tab2

outputs:
  - name: q13403.out
    data: |
      -3
